import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';

function CvJson() {
    // State to store the CV data
    const [cvData, setCvData] = useState(null);
    const [error, setError] = useState(null);
  
    // Effect to fetch the CV data when the component mounts
    useEffect(() => {
      // Fetch the JSON file
      fetch('./cv.json')
        .then(response => {
          if (!response.ok) {
            throw new Error('Failed to fetch CV data');
          }
          return response.json();
        })
        .then(data => {
          // Set the fetched data to the state
          setCvData(data);
        })
        .catch(error => {
          console.error('Error fetching CV data:', error);
          setError(error);
        });
    }, []); // Empty dependency array ensures the effect runs only once when the component mounts

    // Render any errors
    if (error) {
        return <div>Error: {error.message}</div>;
    }

    return cvData;
}

function CV() {
    // Call the CvJson function to fetch the CV data
    const cvData = CvJson();

    return (
        <div>
            <header>
                <h1>Linus Aspelof</h1>
                <nav>
                    <ul>
                        <li><Link to="/">Om Mig</Link></li>
                        <li><Link to="/About">Om Mig</Link></li>
                        <li className="active"><Link to="/CV">Cv</Link></li>
                        <li><Link to="/Portfolio">Portfolio</Link></li>
                        <li><Link to="/Kontakt">Kontakt</Link></li>
                    </ul>
                </nav>
            </header>

            <main id="cv-container">
                {/* Render CV data if available */}
                {cvData && (
                    <div>
                        <h2>Education</h2>
                        {/* Render education */}
                        <ul>
                            {cvData.education.map((item, index) => (
                                <li key={index}>
                                    <strong>{item.degree}</strong> - {item.school} ({item.year})
                                </li>
                            ))}
                        </ul>

                        <h2>Work Experience</h2>
                        {/* Render work experience */}
                        <ul>
                            {cvData.workExperience.map((item, index) => (
                                <li key={index}>
                                    <strong>{item.title}</strong> at {item.company} ({item.year}) - {item.description}
                                </li>
                            ))}
                        </ul>
                    </div>
                )}
            </main>

            <footer>
                <p>&copy; 2024 Linus Aspelöf. All rights reserved.</p>
            </footer>
        </div>
    );
}

export default CV;
